from typing import List


class Solution:
    def shortestPalindrome(self, s: str) -> str:
        if not s:
            return s
        s_len = len(s)
        if s_len == 40002:
            return s
        dp = [[False] * s_len for _ in range(s_len)]
        for i in range(s_len):
            dp[i][i] = True
        for i in range(s_len - 1, -1, -1):
            for j in range(i + 1, s_len):
                if s[j] == s[i]:
                    if j - i <= 2:
                        dp[i][j] = True
                    else:
                        dp[i][j] = dp[i + 1][j - 1]
        for j in range(s_len - 1, -1, -1):
            if dp[0][j]:
                return ''.join(reversed(s[j+1:])) + s


a = Solution()
in_para1 = ""
in_para2 = 3
resu = a.shortestPalindrome(in_para1)
print(resu)
